    "Simultaneous Differential Polarimetric Measurements and Co-Polar Correlation Coefficient
    Measurement",nt"tracking_summary": {ntt"total": 11,ntt"recent": 2nt},nt"groups":
    [],nt"relationships_as_subject": [],nt"revision_timestamp": "2015-08-14T06:38:37.870364",nt"name":
    "simultaneous-differential-polarimetric-measurements-and-co-polar-correlation-coefficient-m-ade79",nt"isopen":
    true,nt"url": null,nt"notes": "A polarimetric Doppler weather radar system
    which allows measurement of linear orthogonal polarimetric variables without a switch
    by using simultaneous transmission of horizontally and vertically polarized waves.
    This is accomplished by splitting the transmitted power into two waveguides and
    combining them with an orthomode coupler at the antenna feed. Thus, in general the
    transmitted polarization is elliptical but with equal amount of power in horizontal
    and vertical polarization. On reception, the power is divided, at the orthomode
    coupler, into linear horizontal and vertical components. These components are processed
    and combined to yield Doppler and polarimetric information about storm structure.",nt"license_title":
